void print(int n, string prefix) {
    if (n == 0) {
        cout << prefix << endl;
    } else {
        print(n - 1, prefix + "0");
        print(n - 1, prefix + "1");
    }
}

int main() {
    int n;
    cin >> n;
    print(n, "");
    return 0;
}
